import React from "react";
import "../css/mainBlock.css";
import logo from "../img/logo.png";
function Header() {
  return (
    <header>
      <div className="container">
        <a href="#">
          <img src={logo} alt="logo" />
        </a>
      </div>
    </header>
  );
}

function MainBlock() {
  return (
    <section className="main-block">
      <Header />
    </section>
  );
}
export default MainBlock;
